import React from "react";

function Index() {
  return (
    <div className="bg-smokegrey text-sm">
      <p className="flex ">
        By accessing using this website, you acknoledge that you have read and
        understand our <p className="text-darkblue"> Cookie Police</p>,
        <p className="text-darkblue"> Privacy Police</p>, and our{" "}
        <p className="text-darkblue"> Terms of service</p>
      </p>
    </div>
  );
}

export default Index;
